import React, { Component } from 'react';
import NavBarItem from './NavBarItem';


class NavBar extends Component {

    constructor(props) {
        super(props);
        
    this.state = {

        items: [
        {name: "Item 1", href: "/"},
        {name: "Item 2", href: "/"},
        {name: "Item 3", href: "/"},
        {name: "Item 4", href: "/"}
        ]
    }

}
onClickHandler(item) {
    alert(item.name);

}

    render() {
        return (
            <div>
                {this.state.items.map(i => <NavBarItem 
                item={i}
                onClick={this.onClickHandler()}
               />)}
            </div>
        );
    }
}

export default NavBar;
